  <>
  <div class="container">
  <h1>
    List of 5 best Nextflix series
  </h1>
  <div className="flex">
  <Card
  imgsrc={sdata[0].imgsrc}
  title={sdata[0].title}
  sname={sdata[0].sname}
  links={sdata[0].links}/> 
  <Card
  imgsrc={sdata[1].imgsrc}
  title={sdata[1].title}
  sname={sdata[1].sname}
  links={sdata[1].links}/> 
  <Card
  imgsrc={sdata[2].imgsrc}
  title={sdata[2].title}
  sname={sdata[2].sname}
  links={sdata[2].links}/> 
  </div>
  </div>
   </>
 ,
  document.getElementById("root")         
